import React from 'react';
import { Link } from 'react-router-dom';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import './LandingPage.css'; // Assuming you have a CSS file for styling

const LandingPage = () => {
    return (
        <div className="landing-page">
            <Navbar />
            <div className="hero-section">
                <h1>Welcome to the Data Science Platform</h1>
                <p>Your journey to mastering data science starts here.</p>
                <Link to="/sign-up" className="btn">Get Started</Link>
            </div>
            <Footer />
        </div>
    );
};

export default LandingPage;
